        public ExportResult ExportGenericReport<T>(Func<ReportFilterDto, List<T>> fetchMethod, ReportFilterDto filter, string reportName)
        {
            var data = fetchMethod(filter);
            return _reportExporter.ExportToExcel(data, $"{reportName} - {DateTime.Now.ToFarsi()}");
        }

